package ManishLokesh.Neptune.v2.Orders.ResponseBody;public class OrderOutletResponse {    private Long id;    private String outletName;    private String mobileNo;    private String fssaiNo;    private String city;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getOutletName() {        return outletName;    }    public void setOutletName(String outletName) {        this.outletName = outletName;    }    public String getMobileNo() {        return mobileNo;    }    public void setMobileNo(String mobileNo) {        this.mobileNo = mobileNo;    }    public String getFssaiNo() {        return fssaiNo;    }    public void setFssaiNo(String fssaiNo) {        this.fssaiNo = fssaiNo;    }    public String getCity() {        return city;    }    public void setCity(String city) {        this.city = city;    }}